import React, { Component } from 'react';
import './App.css';
import MyNav from './components/Nav';
import About from './components/About'
import Header from './components/Header';


class App extends Component {
  render() {
    return (
      <div className="App">
        <MyNav />
        <Header /> 
        <About />

      </div>
    );
  }
}

export default App;
